import { LoaderArgs } from '@remix-run/cloudflare'
import { image } from 'remix-utils'
import { Buffer } from '../utils/buffer.server'

const pre = `
<svg xmlns="http://www.w3.org/2000/svg" width="80" height="80" fill="none" viewBox="0 0 100 100"><circle cx="50%" cy="50%" r="50%" fill="#fbe047"/>`

const svg = `<style>image{animation:fade-in-and-out 0.2s steps(1, end) forwards}@media (prefers-reduced-motion){image{animation:none}[class^=primary]{opacity:1}}@keyframes fade-in-and-out{0%{opacity:0}10%{opacity:1}90%{opacity:1}100%{opacity:0}}@keyframes fade-in{0%{opacity:0}100%{opacity:1}}</style><mask id="circle-6"><circle cx="11.895" cy="28" r="6" fill="#fff"/></mask><path stroke="rgba(0, 0, 0, 0.15)" stroke-linecap="round" stroke-width="1.5" d="M50 50 17.091 31"/><circle cx="11.895" cy="28" r="6" fill="rgba(0,0,0,0.5)" stroke="#fff" stroke-width="3" mask="url(#circle-6)"/><mask id="circle-4"><circle cx="89.837" cy="27" r="4" fill="#fff"/></mask><path stroke="rgba(0, 0, 0, 0.15)" stroke-linecap="round" stroke-width="1.5" d="m50 50 36.373-21"/><circle cx="89.837" cy="27" r="4" fill="rgba(0,0,0,0.5)" stroke="#fff" stroke-width="3" mask="url(#circle-4)"/><mask id="circle-3"><circle cx="18.551" cy="15.072" r="3" fill="#fff"/></mask><path stroke="rgba(0, 0, 0, 0.15)" stroke-linecap="round" stroke-width="1.5" d="M50 50 20.558 17.302"/><circle cx="18.551" cy="15.072" r="3" fill="rgba(0,0,0,0.5)" stroke="#fff" stroke-width="3" mask="url(#circle-3)"/><g id="other"><image width="80" height="80" x="10" y="10" href="data:image/png;charset=utf-8;base64," opacity="0" style="animation-delay:0s"/><image width="80" height="80" x="10" y="10" href="data:image/png;charset=utf-8;base64," opacity="0" style="animation-delay:0.15s"/><image width="80" height="80" x="10" y="10" href="data:image/png;charset=utf-8;base64," opacity="0" style="animation-delay:0.3s"/><image width="80" height="80" x="10" y="10" href="data:image/png;charset=utf-8;base64," opacity="0" style="animation-delay:0.44999999999999996s"/><image width="80" height="80" x="10" y="10" href="data:image/png;charset=utf-8;base64," opacity="0" style="animation-delay:0.6s"/><image width="80" height="80" x="10" y="10" href="data:image/png;charset=utf-8;base64," opacity="0" style="animation-delay:0.75s"/><image width="80" height="80" x="10" y="10" href="data:image/png;charset=utf-8;base64," opacity="0" style="animation-delay:0.8999999999999999s"/><image width="80" height="80" x="10" y="10" href="data:image/png;charset=utf-8;base64," opacity="0" style="animation-delay:1.05s"/><image width="80" height="80" x="10" y="10" href="data:image/png;charset=utf-8;base64," opacity="0" style="animation-delay:1.2s"/><image width="80" height="80" x="10" y="10" href="data:image/png;charset=utf-8;base64," opacity="0" style="animation-delay:1.3499999999999999s"/></g><image width="90" height="90" x="5" y="5" class="primary-0" href="data:image/png;charset=utf-8;base64," mask="url(#slice-0)" opacity="0" style="animation:fade-in 0.2s steps(1, end) forwards;animation-delay:1.3499999999999999s"/><mask id="slice-0"><path fill="#fff" d="M0 0h100v100H0z"/></mask></svg>`

export async function loader({ params }: LoaderArgs) {
  // await new Promise((res) => setTimeout(res, 1000))

  // return image(Buffer.from(svg), {
  //   type: 'image/svg+xml',
  // })

  let { readable, writable } = new TransformStream()
  const writer = writable.getWriter()
  const encoder = new TextEncoder()
  writer.write(encoder.encode(pre))
  writer.write(new Uint8Array(4096).fill(32))
  ;(async () => {
    await new Promise((res) => setTimeout(res, 3000))
    writer.write(encoder.encode(svg))
    writer.close()
  })()
  return image(readable, {
    type: 'image/svg+xml',
  })
}
